CREATE TABLE IF NOT EXISTS syslog.rh_trab (
    clave INTEGER UNSIGNED NOT NULL COMMENT 'Ficha',
    nombre VARCHAR(40) NOT NULL COMMENT 'Nombre del trabajador',
    ap_pat VARCHAR(40) NOT NULL COMMENT 'Apellido Paterno',
    ap_mat VARCHAR(40) COMMENT 'Apellido Materno',
    ncorto VARCHAR(80) NOT NULL  COMMENT 'Nombre Corto',
    apodo VARCHAR(35) COMMENT 'Sobrenombre',
    activo TINYINT NOT NULL DEFAULT 1 COMMENT 'Activo',
    curp VARCHAR(18) COMMENT 'Clave Unica de Registro de Poblacion',
    rfc VARCHAR(15) COMMENT 'Registro Federal de Causantes',
    calle_no VARCHAR(35) COMMENT 'Calle y núm.',
    colonia VARCHAR(35) COMMENT 'Colonia',
    ciudad VARCHAR(25) COMMENT 'Ciudad/Municipio',
    estado VARCHAR(25) COMMENT 'Entidad Federativa',
    pais VARCHAR(25) DEFAULT 'MEXICO' COMMENT 'País',
    nacionalidad VARCHAR(25) DEFAULT 'MEXICANA' COMMENT 'Nacionalidad',
    edo_civil ENUM('SOLTERO', 'CASADO', 'VIUDO', 'SEPARADO', 'UNION LIBRE') COMMENT 'Estado Civil',
    sexo ENUM('MASCULINO', 'FEMENINO') COMMENT 'Género',
    tel VARCHAR(25) COMMENT 'Teléfono(s)',
    email VARCHAR(80) COMMENT 'Correo electrónico',
    fec_cat DATE COMMENT 'Fecha firma en puesto actual',
    fec_depto DATE COMMENT 'Fecha adscripción al depto',
    fec_planta DATE COMMENT 'Fecha Firma Planta',
    fec_ingreso DATE COMMENT 'Fecha Ingreso',
    fec_nac DATE COMMENT 'Fecha de Nacimiento',
    reg_cont ENUM('P', 'T') COMMENT 'Régimen Contractual',
    reg_sind ENUM('S', 'C') COMMENT 'Régimen Sindical',
    PRIMARY KEY(clave),
    INDEX IDX_nombre(nombre ASC),
    INDEX IDX_ape(ap_pat ASC)
) ENGINE=InnoDB DEFAULT CHARACTER SET=utf8 COLLATE=utf8_spanish_ci;




